import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';

const FIELD_CONFIG = [
  { name: 'registrationType', type: 'select', label: 'Registration Type', options: ['New', 'Transfer', 'Regular Member', 'Associate Member'] },
  { name: 'memberComposition', type: 'text', label: "Member's Composition" },
  { name: 'dateOfRegistration', type: 'date', label: 'Date of Registration' },
  { name: 'sharedCapital', type: 'number', label: 'Shared Capital' },
  { name: 'lastName', type: 'text', label: 'Last Name' },
  { name: 'firstName', type: 'text', label: 'First Name' },
  { name: 'middleName', type: 'text', label: 'Middle Name' },
  { name: 'contactNumber', type: 'text', label: 'Contact Number' },
  { name: 'address', type: 'text', label: 'Address' },
];

const AddMemberModal = ({ isOpen, onClose, onSave, memberIdToEdit }) => {
  const [newMember, setNewMember] = useState({});
  const [message, setMessage] = useState('');
  const { id } = useParams();

  const fetchMemberData = async (id) => {
    try {
      const response = await axios.get(`http://localhost:3001/api/members/${id}`);
      setNewMember(response.data || {});
    } catch (error) {
      console.error('Error fetching member data:', error);
      setMessage('Error fetching member data. Please try again later.');
    }
  };

  useEffect(() => {
    if (isOpen) {
      memberIdToEdit ? fetchMemberData(memberIdToEdit) : setNewMember({});
    }
  }, [isOpen, memberIdToEdit]);

  const handleChange = (name, value) => {
    setNewMember((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const formData = new FormData();
    Object.entries(newMember).forEach(([key, value]) => value && formData.append(key, value));

    try {
      const response = await axios[memberIdToEdit ? 'put' : 'post'](
        `http://localhost:3001/api/members${memberIdToEdit ? `/${memberIdToEdit}` : ''}`,
        formData,
        { headers: { 'Content-Type': 'multipart/form-data' } }
      );
      setMessage(response.data.message || 'Member saved successfully!');
      onSave(newMember);
      setNewMember({});
    } catch (error) {
      console.error('Error saving member data:', error);
      setMessage('Error saving member data. Please try again later.');
    }
  };

  if (!isOpen) return null;

  return (
    <div className="fixed inset-0 flex items-center justify-center z-50">
      <div className="fixed inset-0 bg-black opacity-50" />
      <div className="bg-white rounded-lg shadow-lg p-6 w-11/12 md:w-1/2 lg:w-1/3 relative z-10 max-h-[80vh] overflow-auto">
        <button onClick={onClose} className="text-red-500 text-2xl font-bold">&times;</button>
        <h1 className="text-2xl font-bold text-gray-800 mb-4">Member Management</h1>
        {message && <p className="text-red-500">{message}</p>}
        <form onSubmit={handleSubmit}>
          {FIELD_CONFIG.map(({ name, type, label, options }) => (
            <div key={name} className="mb-4">
              <label className="block text-gray-700">{label}:</label>
              {type === 'select' ? (
                <select
                  value={newMember[name] || ''}
                  onChange={(e) => handleChange(name, e.target.value)}
                  className="mt-1 p-2 border border-gray-300 rounded-md w-full"
                >
                  <option value="">Select</option>
                  {options.map((option) => (
                    <option key={option} value={option}>{option}</option>
                  ))}
                </select>
              ) : (
                <input
                  type={type}
                  value={newMember[name] || ''}
                  onChange={(e) => handleChange(name, e.target.value)}
                  className="mt-1 p-2 border border-gray-300 rounded-md w-full"
                />
              )}
            </div>
          ))}
          <button type="submit" className="bg-blue-500 text-white px-4 py-2 rounded">Save</button>
        </form>
      </div>
    </div>
  );
};

export default AddMemberModal;
